    }
    10%, 90% {
        opacity: 1;
        transform: translateX(-50%) translateY(0);
    }
}

@keyframes slideDown {
    from {
        transform: translateX(-50%) translateY(-100%);
        opacity: 0;
    }
    to {
        transform: translateX(-50%) translateY(0);
        opacity: 1;
    }
}

/* 响应式设计 */
@media (max-width: 480px) {
    #app {
        max-width: 100%;
    }

    .main-content {
        padding: 15px;
    }

    .emoji-selector {
        gap: 10px;
    }

    .emoji-btn {
        width: 50px;
        height: 50px;
        font-size: 20px;
    }

    .shop-categories {
        flex-direction: column;
    }

    .history-item {
        grid-template-columns: 1fr;
        text-align: center;
        gap: 5px;
    }
