                    effect: {}
                },
                thoughtful: {
                    mood: 'thoughtful',
                    messages: ['主人在思考什么呢？', '我也在想...', '深度思考中'],
                    effect: { happiness: 3 }
                }
            };

            const reaction = reactions[mood] || reactions.neutral;

            // 设置宠物心情和消息
            this.pet.mood = reaction.mood;
            this.pet.message = reaction.messages[Math.floor(Math.random() * reaction.messages.length)];

            // 应用效果
            Object.keys(reaction.effect).forEach(key => {
                this.pet[key] = Math.max(0, Math.min(100, this.pet[key] + reaction.effect[key]));
            });

            // 清除消息
            setTimeout(() => {
                this.pet.message = '';
            }, 3000);
        },

        // 重置心情表单
        resetMoodForm() {
            this.selectedMood = null;
            this.moodText = '';
            this.voiceText = '';
        },

        // 语音录制切换
        toggleVoiceRecording() {
            if (!('webkitSpeechRecognition' in window) && !('SpeechRecognition' in window)) {
                this.showNotification('您的浏览器不支持语音识别', 'error');
