        startVoiceRecording() {
            const SpeechRecognition = window.SpeechRecognition || window.webkitSpeechRecognition;
            this.recognition = new SpeechRecognition();

            this.recognition.lang = 'zh-CN';
            this.recognition.continuous = false;
            this.recognition.interimResults = false;

            this.recognition.onstart = () => {
                this.isRecording = true;
            };

            this.recognition.onresult = (event) => {
                const result = event.results[0][0].transcript;
                this.voiceText = result;
                this.showNotification('语音识别成功！', 'success');
            };

            this.recognition.onerror = (event) => {
                this.showNotification('语音识别失败，请重试', 'error');
                this.isRecording = false;
            };

            this.recognition.onend = () => {
                this.isRecording = false;
            };

            this.recognition.start();
        },

        // 停止语音录制
        stopVoiceRecording() {
            if (this.recognition) {
                this.recognition.stop();
            }
            this.isRecording = false;
        },

        // 购买物品
        buyItem(item) {
            if (this.user.coins < item.price) {
                this.showNotification('金币不足！', 'error');
                return;
            }

            // 扣除金币
            this.user.coins -= item.price;

            // 应用物品效果
            Object.keys(item.effect).forEach(key => {
                this.pet[key] = Math.max(0, Math.min(100, this.pet[key] + item.effect[key]));
            });

            // 宠物反应
            this.pet.message = `谢谢主人的${item.name}！`;
            setTimeout(() => {
                this.pet.message = '';
