            if (avgStatus >= 80) {
                this.pet.mood = 'happy';
            } else if (avgStatus >= 60) {
                this.pet.mood = 'neutral';
            } else if (avgStatus >= 40) {
                this.pet.mood = 'sad';
            } else {
                this.pet.mood = 'angry';
            }
        },

        // 获取心情表情
        getMoodEmoji(moodType) {
            const mood = this.moodEmojis.find(m => m.type === moodType);
            return mood ? mood.emoji : '😐';
        },

