        formatDate(date) {
            return new Date(date).toLocaleDateString('zh-CN', {
                month: 'short',
                day: 'numeric',
                hour: '2-digit',
                minute: '2-digit'
            });
        },

        // 显示通知
        showNotification(message, type = 'info') {
            this.notification = { message, type };
            setTimeout(() => {
                this.notification = null;
            }, 3000);
        },

        // 保存数据到本地存储
        saveData() {
            const data = {
                user: this.user,
                pet: this.pet,
                moodHistory: this.moodHistory
            };
            localStorage.setItem('moodPetData', JSON.stringify(data));
        },

        // 从本地存储加载数据
        loadData() {
            const saved = localStorage.getItem('moodPetData');
            if (saved) {
                try {
                    const data = JSON.parse(saved);
                    this.user = { ...this.user, ...data.user };
                    this.pet = { ...this.pet, ...data.pet };
                    this.moodHistory = data.moodHistory || [];
                } catch (e) {
                    console.error('加载数据失败:', e);
                }
            }
        },

