                this.pet.hunger = Math.max(0, this.pet.hunger - hungerDecay);
            }

            // 清洁度衰减
            if (this.pet.lastCleaned) {
                const cleanDecay = Math.floor((now - this.pet.lastCleaned) / 60000) * (decayRate * 0.8);
                this.pet.cleanliness = Math.max(0, this.pet.cleanliness - cleanDecay);
