                this.pet.happiness = Math.max(0, this.pet.happiness - happyDecay);
            }

            // 更新宠物心情
            this.updatePetMood();

            // 保存数据
            this.saveData();
        }
    },

    mounted() {
        // 加载保存的数据
        this.loadData();

        // 更新宠物心情
        this.updatePetMood();

