            this.showNotification(`购买 ${item.name} 成功！`, 'success');

            // 保存数据
            this.saveData();
        },

        // 更新宠物心情
        updatePetMood() {
            const avgStatus = (this.pet.hunger + this.pet.cleanliness + this.pet.happiness) / 3;

            if (avgStatus >= 80) {
                this.pet.mood = 'happy';
            } else if (avgStatus >= 60) {
                this.pet.mood = 'neutral';
            } else if (avgStatus >= 40) {
                this.pet.mood = 'sad';
            } else {
                this.pet.mood = 'angry';
            }
        },

        // 获取心情表情
        getMoodEmoji(moodType) {
            const mood = this.moodEmojis.find(m => m.type === moodType);
            return mood ? mood.emoji : '😐';
        },

        // 格式化日期
        formatDate(date) {
            return new Date(date).toLocaleDateString('zh-CN', {
                month: 'short',
                day: 'numeric',
                hour: '2-digit',
                minute: '2-digit'
            });
        },

        // 显示通知
        showNotification(message, type = 'info') {
            this.notification = { message, type };
            setTimeout(() => {
                this.notification = null;
            }, 3000);
        },

        // 保存数据到本地存储
        saveData() {
            const data = {
